// POST request to save steps data
router.post('/steps', (req, res) => {
    const { steps } = req.body;
    const newStep = new Step({ steps });
    newStep.save()
        .then(() => res.status(201).send('Step data saved'))
        .catch((err) => res.status(500).send("Error saving step data"));
});

// GET request to retrieve steps data (optional)
router.get('/steps', (req, res) => {
    Step.find()
        .then((steps) => res.json(steps))
        .catch((err) => res.status(500).send("Error retrieving step data"));
});

export default router;  // Export 'router' instead of 'stepRouter'

